import { View, StyleSheet, Text } from 'react-native'
import React from 'react'

const Navbar = () => {
    return (
        <View style={styles.container}>
            <Text>Navbar</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        marginTop: 10,
        color: "#fff",
        backgroundColor: "#000",
        padding: '10px'
    },
    textSTyle: {
  color:"#fff"
    }
})



export default Navbar
